  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Great River National
  Wildlife Refuge outlines Refuge accomplishments from September through December
  of 1963. The report begins by summarizing the weather conditions, habitat conditions,
  water conditions, and food and cover during this period. Wildlife- including migratory
  birds, upland game birds, big game animals, furbearers, predators, rodents, raptors,
  fish, and reptiles- is also covered. The Refuge development and maintenance section
  discusses physical developments and plantings. The resource management section discusses
  timber harvesting. The public relations section of the report describes recreational
  uses, Refuge visitors, Refuge participation, hunting, violations, and safety. Items
  of interest, N-R forms, and photographs are attached.\",\n\t\"license_title\": \"License
